description:
GTX est un outils collaboratif et visuel. Et vos projets deviennent clair.

GTX  vous offre un nouveau point de vue sur tous vos projets, au bureau comme à la maison.

Qu'il s'agisse de gérer une équipe, un projet, un backlog ou une tâche
GTX est le compagnon idéal pour être actif et organisé.

Avec GTX , vous pouvez :

• personnaliser les flux de travail pour différents projets ;
• ajouter des projets, backlogs, ou tâches ;
• attribuer des tâches à vos collègues et à vous-même ;
• commenter des éléments avec vos amis ;
• joindre des fichiers ;
• importer des photos et des vidéos ;
• répondre à des commentaires ou chatter ;
